MongoDB & PHP | How to add object into existing document?<p>I am very new to MongoDB and PHP and I am trying to add an object into an already existing document.
The problem is that I am seeing the <code>$push</code> variable being used a lot, but can't seem to get it working on my own project.</p>
<p><strong>My Document</strong></p>
<pre><code>{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;622dfd21f8976876e162c303&quot;
    },
    &quot;name&quot;: &quot;testuser&quot;,
    &quot;password&quot;: &quot;1234&quot;
}
</code></pre>
<p>Lets say this is a document inside my collection <code>users</code>. I want to add an object that is called <code>domains</code> with some data inside that object like below:</p>
<pre><code>&quot;domains&quot;: {
        &quot;name&quot;: &quot;example.com&quot;
}
</code></pre>
<p>I have tried a bunch of different things, but they do not seem to work.
<strong>What I tried:</strong>
I have tried doing to like this:</p>
<pre><code>$doc = array(
    &quot;domains&quot; =&gt; array(&quot;name&quot;: &quot;nu.nl&quot;)
);

$collection-&gt;insert($doc);
</code></pre>
<p>And like this:</p>
<pre><code>$insertOneResult = $collection-&gt;updateOne(
    {&quot;name&quot; : &quot;testuser&quot;},
    '$push': {&quot;domains&quot;: {&quot;name&quot;: &quot;example.com&quot;}}
); 
</code></pre>
<p>But they both do not work.
Can anyone help me with this problem or comment a link which would help me with this problem?
Thanks in advance!</p>

