Returning a single object from Go Mongo API<p>The trouble I've been having is that the code bellow only works if the token isn't in an array, (or is considered the original refresh token the rest descend from). I'm wasting so much precious energy trying to find a way to return the correct session.</p>
<pre class="lang-golang prettyprint-override"><code>// Find the current sessions info
currentSession := model.Session{}
lookupSession := bson.D{{Key: &quot;token&quot;, Value: refreshToken}}
_ := tokensCol.FindOne(ctx, lookupSession).Decode(&amp;currentSession)
</code></pre>
<pre><code>token: &quot;eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE2NDcyMzAxNTJ9.R-Tm8sgs...&quot;
userID: &quot;1&quot;
userAgent: &quot;&quot;
ip: &quot;&quot;
exp: 1647230152
valid: false
original: true
family:
   0:
      token: &quot;eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE2NDcyMzAyNTJ9.noqkeUYW...&quot;
      userID: &quot;1&quot;
      userAgent: &quot;&quot;
      ip: &quot;&quot;
      exp: 1647230252
      valid: true
      original: false
</code></pre>
<p>Is there a one stop shop for returning the object the token resides either at the top-level of the document or nested within the <code>family</code> array? The code bellow partially works, but returns the entire document starting with the original token. Not sure how to shape the data retrieved</p>
<pre class="lang-golang prettyprint-override"><code>currentSession := model.Session{}
filter := bson.M{
    &quot;family&quot;: bson.M{
        &quot;$elemMatch&quot;: bson.M{&quot;token&quot;: refreshToken},
    },
}
_ = tokensCol.FindOne(ctx, filter).Decode(&amp;currentSession)

fmt.Println(currentSession)
</code></pre>
<p>Returns:</p>
<pre><code>{c8ncjdiaas68dh9fq1d0 eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE2NDcyMzcwNjJ9.KlR1mdC0UBnGfxr31MZwzoE7tTVQwuN5uciteSqh8Kg 1 1647237062 false true [{c8ncjhaaas68dh9fq1dg eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE2NDcyMzcwNzd9.lx6MIBN_pzlKei9DWr0-k-kvr6yLJ4XfhGSTNNVqRKY 1 1647237077 true false []}]}
</code></pre>
<p>EDIT: Great, however.. I'm still only returning the original token at the top of the document and not the nested object that I need? The only difference is that the value of the token returns correctly when instead of throwing <code>&quot;token&quot;: 1</code>, I say <code>&quot;token&quot;: refreshToken</code></p>
<pre class="lang-golang prettyprint-override"><code>session := model.Session{}
lookupSession := bson.M{
    &quot;$or&quot;: []bson.M{
        {&quot;token&quot;: refreshToken},
        {&quot;family.token&quot;: refreshToken},
    },
}
opts := options.FindOne().SetProjection(
    bson.M{
        &quot;token&quot;:     refreshToken,
        &quot;userid&quot;:    1,
        &quot;useragent&quot;: 1,
        &quot;ip&quot;:        1,
        &quot;exp&quot;:       1,
        &quot;valid&quot;:     1,
        &quot;original&quot;:  1,
    },
)
lookupErr := tokensCol.FindOne(ctx, lookupSession, opts).Decode(&amp;session)
</code></pre>
<p>I really need the returned document from <code>FindOne</code> to include specific data from the object and not the top-level of the document. As I won't be running checks on that, as it would be invalid. Any Comments or advice for this??</p>

