<p>When I retrieve this property, i want its value to be set on two different properties of my POJO, <code>foo</code> and <code>bar</code></p>
<p>So if a document is registered as:</p>
<pre><code>{
  &quot;_id&quot;: &quot;xxxxxx&quot;,
  &quot;foo&quot;: &quot;123&quot;,
}
</code></pre>
<p>When the service retrieves it from the DB, i want the fetched entity to look like this:</p>
<pre><code>{
  &quot;_id&quot;: &quot;xxxxxx&quot;,
  &quot;foo&quot;: &quot;123&quot;,
  &quot;bar&quot;: &quot;123&quot;,
}
</code></pre>
<p>Is there a way to achieve this only changing the entity class? I tried the following and it didn't work</p>
<pre><code>@Getter
@Setter
@Document(&quot;test&quot;)
public class MyClass {
    @Id
    private String _id;

    @BsonProperty(&quot;foo&quot;)
    private String bar;

    private String foo;

}
</code></pre>
<p>I'm using Spring Webflux and Reactive MongoDB stack.</p>

