<p>.. as per this page: <a href="https://stackoverflow.com/questions/39338112/mongodb-query-to-find-the-document-in-nested-array">mongoDB query to find the document in nested array</a>
... but go no where fast with that approach. i.e. no records at all.</p>
<p>What query do I need, please, to achieve something like this..?</p>
<pre><code>[
{ &quot;code&quot;: &quot;L111&quot; },
{ &quot;code&quot;: &quot;L999&quot; },
...
]
</code></pre>
<p>or even better, this..?</p>
<pre><code>[
&quot;L111&quot;,
&quot;L999&quot;,
