Express subpath GET returns 404 with no content<p>I'm dealing with an Express + MongoDB (w/Mongoose) project for an interview for which I need to add an endpoint.</p>
<p>The endpoint is a <strong>GET /listings/ranking</strong> where I'm supposed to get all the products listed and sort them in a descending order by the quantity sold. I wrote the endpoint in the <code>server/api/listing/index.js</code> file (only that endpoint, the other was already there):</p>
<pre><code>var controller = require(&quot;./listing.controller&quot;);
var config = include(&quot;config/environment&quot;);
var router = express.Router();

var { route } = require(&quot;endpoint-handler&quot;)(router)

route.get(&quot;/&quot;, controller.getAll);

route.get(&quot;/:listing_id&quot;, controller.getOne);

route.get(&quot;/ranking&quot;, controller.getMostSold);

module.exports = router;
</code></pre>
<p>The code for <code>getMostSold</code> in the controller (<code>server/api/listing/listing.controller</code>):</p>
<pre><code>var Listing = require(&quot;./listing.model&quot;);

exports.getAll = (req, res) =&gt; Listing.find({});

exports.getOne = (req, res) =&gt; Listing.findOne({
    listing_id: req.params.listing_id
  })
  .then(listing =&gt; {
    if (!listing) {
      throw { name: &quot;NotFound&quot;, statusCode: 404 };
    }
    return listing;
  });

exports.getMostSold = (req, res) =&gt; {
  var defaultLimit = 3;
  Listing.find({})
    .sort('-quantity')
    .limit(req.query.limit || defaultLimit);
};
</code></pre>
<p>And the corresponding spec in <code>server/api/listing/router.spec.js</code>:</p>
<pre><code>var should = require(&quot;chai&quot;).should();
var request = require('supertest');
var app = include('app').app;
var Listing = require('./listing.model');

describe('Listing', () =&gt; {
  var samsung = {...};

  beforeEach((done) =&gt; {
    return Listing.create(samsung, done);
  });

  describe('GET /listings', function() {
    it('should return all the listings', (done) =&gt; {
      request(app).get('/listings').expect(200, [samsung], done);
    });
  });

  describe('GET /listings/:listing_id', function() {

    it('should return the requested listing', (done) =&gt; {
      request(app).get('/listings/MLA1111').expect(200, samsung, done);
    });

    it('should return 404 Not Found when the requested listing does not exist', (done) =&gt; {
      request(app).get('/listings/WRONGID').expect(404, done);
    });

  });

  describe('GET /listings/ranking', function() {
    var motoG = {...};
    var onePlus = {...};
    var iPhone = {...};
    Listing.create(motoG);
    Listing.create(onePlus);
    Listing.create(iPhone);

    it('should return the top 3 most sold listings since monitoring started', (done) =&gt; {
      request(app).get('/listings/ranking').expect(200, [samsung, motoG, onePlus, iPhone], done);
    });

    it('should return the top N most sold listings since monitoring started', (done) =&gt; {
      var topN = 2;
      request(app).get(`/listings/ranking?limit=${topN}`).expect(200, [motoG, samsung], done);
    });
  });
</code></pre>
<p>Both specs for my endpoint are failing while the other works just fine. And it's not that they're returning something else, they're just <strong>not returning anything at all other than an empty 404</strong>. I tried changed my endpoint's controller's code to be just <code>Listing.find({})</code> like for the <code>.getAll</code> method, but it's still returning <code>{}</code>.</p>
<p>I suspect it's just a routing problem because of what I just said. Even though I changed the code, it's like it's not recognizing that there's an endpoint called <code>/listings/ranking</code>.</p>
<p>Here's the <code>server/routes.js</code> file just in case:</p>
<pre><code>var errors = require(&quot;./components/errors&quot;);

module.exports = (app) =&gt; {
  app.use(&quot;/listings&quot;, require(&quot;./api/listing&quot;));
  app.route(&quot;/:url(api|components|app|bower_components|assets)/*&quot;).get(errors[404]);
};
</code></pre>
<p>And here's what the project structure looks like:
<a href="https://i.stack.imgur.com/CxTbm.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/CxTbm.png" alt="Project structure" /></a></p>

